"use strict";

// src/constants.ts
var dataExpiryTime = 60 * 60 * 1e3;

// src/web_accessible_resources.ts
window.addEventListener("message", (ev) => {
  if (ev.data.from === 0 /* Content */) {
    const task = ev.data.payload?.task;
    if (task) {
      const result = Function(`"use strict"; ${task.expression}`)();
      const messageData2 = {
        from: 1 /* Web */,
        payload: { task: { id: task.id, result } }
      };
      window.postMessage(messageData2);
    }
  }
});
var messageData = {
  from: 1 /* Web */,
  payload: { status: "ready" }
};
window.postMessage(messageData);
